export const UserRanked = ({ name, score }) => {
  return (
    <div className="flex items-center font-montserrat">
      <div className=" m-2 rounded-l-xl w-20 h-15 bg-purple-500"></div>
      <div className="text-base block">{name}</div>
      <div className="block">{score}</div>
    </div>
  );
};
